        <h3 class='uppercase sm:text-3xl sm:font-bold sm:tracking-tight'>Psst! Stiai ca sunt consultant IT?</h3>
        <p class="mt-4">Iarta-ma ca te intrerup, probabil nu esti aici pentru reclama, dar poate nu stiai ca imi castig banii din consultanta IT!

          Lucrez full time cu o super agentie din Canada dar, hey, de asemenea ne construim casa noastra la 25 de ani, asa ca fiecare ban e binevenit
          daca e sa fim sinceri. Si cine are nevoie de somn cand poate lucra la proiecte misto?
        </p>
        <p class="mt-4">Am experienta de peste 7 ani in acest domeniu, dar nu experienta pe hartie, ci chiar am facut multe lucruri in acesti ani!</p>
        <p class="mt-4">Te pot ajuta cu o gramada de chestii, vorba aia, <strong>sky is the limit.</strong> Specialitatea mea sunt aplicatiile web, site-urile si mai nou si aplicatiile de mobil.</p>
        <p class="mt-4">Asadar, daca vrei sa te ajut cu un <strong>website</strong>, cu o <strong>aplicatie</strong> pentru tine sau compania ta sau o <strong>aplicatie de mobil</strong>, scrie-mi, sunt convins ca ne vom intelege de minune. In sectiunea <strong>Despre Mine -> Consultanta</strong> ai datele mele. Ne auzim?</p>
        <p class="mt-4 py-12 text-center w-fulL">
